.nuclide-diff-view-component {
  -webkit-user-select: none;
  height: 100%;
  width: 100%;
  /* Let the `<atom-pane-container>` fill the height since it already has `flex: 1` applied. */
  display: flex;
}
.nuclide-diff-view-component .nuclide-diff-view-tree {
  -webkit-user-select: none;
  white-space: nowrap;
  padding-left: 10px;
  padding-right: 10px;
  overflow: auto;
  min-width: 100%;
  min-height: 100%;
  display: inline-block;
}
.nuclide-diff-view-component .diff-timeline {
  width: 100%;
  color: #aaaaaa;
}
.nuclide-diff-view-component .diff-timeline .revision-timeline-wrap {
  height: 100%;
  overflow: auto;
}
.nuclide-diff-view-component .diff-timeline .revision-selector {
  font-family: Menlo, Consolas, monospace;
  font-size: 12px;
  width: 100%;
  white-space: nowrap;
  display: flex;
}
.nuclide-diff-view-component .diff-timeline .revisions {
  display: flex;
  flex-direction: column;
  position: relative;
}
.nuclide-diff-view-component .diff-timeline .revision {
  cursor: pointer;
  margin: auto 1em;
  position: relative;
  z-index: 0;
}
.nuclide-diff-view-component .diff-timeline .revision:hover .revision-label {
  color: #5293d8;
}
.nuclide-diff-view-component .diff-timeline .revision:hover .revision-bubble {
  background-color: #5293d8;
  box-shadow: 0 0 0 2px #5293d8;
}
.nuclide-diff-view-component .diff-timeline .revision-bubble {
  background-color: #5293d8;
  border-radius: 10px;
  display: inline-block;
  height: 10px;
  width: 10px;
  position: absolute;
}
.nuclide-diff-view-component .diff-timeline .revision-bubble::after {
  content: " ";
  display: block;
  width: 1px;
  background-color: #5293d8;
  height: 2em;
  margin-left: 5px;
  margin-top: 5px;
  position: absolute;
  z-index: -1;
}
.nuclide-diff-view-component .diff-timeline .selected-revision-inrange .revision-bubble {
  background-color: #5293d8;
}
.nuclide-diff-view-component .diff-timeline .selected-revision-inrange .revision-bubble::after {
  content: " ";
  width: 10px;
  height: 2.2em;
  background: #5293d8;
  display: block;
  margin-top: 5px;
  margin-left: 0;
}
.nuclide-diff-view-component .diff-timeline .selected-revision-last .revision-bubble::after {
  display: none;
}
.nuclide-diff-view-component .diff-timeline .revision-label {
  margin-bottom: 10px;
  margin-left: 20px;
  display: inline-block;
}
.nuclide-diff-view-component .diff-timeline .selected-revision-start,
.nuclide-diff-view-component .diff-timeline .selected-revision-end {
  font-weight: bold;
}
.nuclide-diff-view-component .diff-timeline .selected-revision-inrange .revision-label,
.nuclide-diff-view-component .diff-timeline .selected-revision-end .revision-label {
  color: #5293d8;
}
.nuclide-diff-view-component .diff-timeline .selected-revision-start .revision-bubble,
.nuclide-diff-view-component .diff-timeline .selected-revision-end .revision-bubble {
  box-shadow: 0 0 0 4px rgba(82, 147, 216, 0.25);
}
.diff-view-count {
  color: #aaaaaa;
  font-size: 0.8em;
  min-width: 2em;
  position: absolute;
  right: 0;
  top: 13px;
  text-shadow: 0 0px 2px rgba(0, 0, 0, 0.5);
  text-align: center;
}
.tool-bar-btn.icon-git-branch {
  position: relative;
}
.tool-bar-btn.icon-git-branch.positive-count {
  color: #ff982d;
}
.tool-bar-btn.icon-git-branch.positive-count:hover {
  color: #ff982d;
}
.tool-bar-btn.icon-git-branch.positive-count .diff-view-count {
  color: #ff982d;
}
atom-text-editor .diff-view-insert .region,
atom-text-editor::shadow .diff-view-insert .region {
  background-color: #2c6c4a;
}
atom-text-editor .diff-view-delete .region,
atom-text-editor::shadow .diff-view-delete .region {
  background-color: #651f21;
}
.nuclide-diff-view-navigation-bar {
  height: 100%;
  width: 100%;
}
.nuclide-diff-view-navigation-target {
  position: absolute;
  width: 100%;
  cursor: pointer;
}
.nuclide-diff-view-navigation-target.added {
  background-color: #17ca65;
}
.nuclide-diff-view-navigation-target.removed {
  background-color: #cc0000;
}
.nuclide-diff-view-navigation-target.modified {
  background-color: #ffaa2c;
}
